- input: "TEXT\x1CC00255695\x1C.TEXT\x1C\x1CF3XN\x1CThe Committee wishes to disclose
    the following:  1) No expenditures designated on Schedule B supporting Line 21b
    were made on behalf of any specifically identified federal candidate(s).  2) The
    Libertarian National Committee (LNC) requests address, employer, and occupation
    information from all contributors whose yearly aggregate contributions exceed
    $200.00 and informs them of the requirement of complying with 11 CFR 104.7(b)(1).
    \ In the event that the information is not supplied as a result of the initial
    request, Committee makes a subsequent attempt to collect the information by mail,
    email, or telephone contact within 30 days of the initial contribution.  This
    'follow up' request a) clearly asks for the missing information without requesting
    a contribution, b) informs the contributor of the requirements for reporting such
    information under federal law, and c) is enclosed with a pre-addressed envelope
    when sent by postal mail.  If the information is submitted after the initial monthly
    report is filed, the contributor master file is updated and the information is
    updated in memo entries filed with the next regularly scheduled report.  The Committee
    also makes periodic requests during the year for all contributors to update their
    contact information and for contributors whose yearly contributions aggregate
    to more than $200 to update their Employer/Occupation information.\n"
